  \"Breeding biology and feeding habits of seabirds of Sitkalidak Strait, 1977-1978:
  Annual report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:58.047039\",\n\t\"name\": \"breeding-biology-and-feeding-habits-of-seabirds-of-sitkalidak-strait-1977-1978-annual-repo\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Breeding chronology for all bird species
  was essentially the same for 1977 and 1978. The number of breeding kittiwakes, gulls
  and terns of both species declined in 1978 whereas the number of breeding tufted
  puffins remained rather constant. Likewise productivity at all stages of breeding:
  number of eggs laid, number of chicks hatched, number of chicks fledged and chicks
  fledged per nest attempt declined for all of the above surface and cliff nesters,
  but not for the tufted puffins. The decline in reproductive output in 1978 was due
  to a number of factors: fewer breeding birds, fewer eggs laid to begin with, increased
  predation of eggs and chicks by mew and glaucous-winged gulls, ravens, northwest
  crows and bald eagles, and perhaps a change in the prey base. The prey base for
  all of the species studied changed radically from 1977 to 1978. In 1977, capelin,
  Mallotus villosus, was by far the most important prey with respect to numbers and
  frequency of occurrence. In 1978 capelin was replaced by sandlance, Ammodytes hexapterus
  as the most important prey and was found in significantly fewer numbers and in significantly
  fewer of the regurgitations and bill loads of the birds than it was in 1977. This
  decline of capelin in 1978 may have somehow influenced the decrease in numbers of
  breeding birds and also their lowered reproductive success.\",\n\t\"license_title\":
